import React from "react";
import { useNavigate } from "react-router-dom";
import { signOut } from "firebase/auth";
import { auth } from "../utils/auth";
import { useTheme } from "../context/ThemeContext";
import SavedTablesPage from "../components/SavedTablesPage";

export default function Dashboard() {
  const navigate = useNavigate();
  const { theme } = useTheme();

  const handleOpenSaved = () => {
    navigate("/log");
  };

  const handleLogout = async () => {
    try {
      await signOut(auth);
      navigate("/login");
    } catch (error) {
      console.error("Error logging out:", error);
    }
  };

  const handleSettings = () => {
    navigate("/settings");
  };

  return (
    <div style={{ 
      background: theme.background, 
      minHeight: "100vh", 
      color: theme.text, 
      padding: "2rem",
      paddingTop: "5rem",
      position: "relative",
      transition: "background-color 0.3s ease, color 0.3s ease"
    }}>
      {/* Settings button */}
      <button
        onClick={handleSettings}
        style={{
          position: "fixed",
          top: "1rem",
          right: "6rem",
          background: theme.accentSecondary,
          color: theme.accent,
          padding: "0.7rem 1.4rem",
          border: "none",
          borderRadius: "10px",
          fontWeight: "600",
          fontSize: "1rem",
          cursor: "pointer",
          zIndex: 1000,
          transition: "background 0.2s ease"
        }}
        onMouseOver={e => e.currentTarget.style.background = theme.accentHover}
        onMouseOut={e => e.currentTarget.style.background = theme.accentSecondary}
      >
        ⚙️ Settings
      </button>

      {/* Logout button */}
      <button
        onClick={handleLogout}
        style={{
          position: "fixed",
          top: "1rem",
          right: "1rem",
          background: theme.danger,
          color: "#fff",
          padding: "0.7rem 1.4rem",
          border: "none",
          borderRadius: "10px",
          fontWeight: "600",
          fontSize: "1rem",
          cursor: "pointer",
          zIndex: 1000,
          transition: "background 0.2s ease"
        }}
        onMouseOver={e => e.currentTarget.style.background = theme.dangerHover}
        onMouseOut={e => e.currentTarget.style.background = theme.danger}
      >
        Logout
      </button>

      <div
        onClick={handleOpenSaved}
        style={{
          overflow: "hidden",
          borderRadius: "1rem",
          border: `2px solid ${theme.accent}`,
          position: "relative",
          cursor: "pointer",
          transition: "transform 0.3s ease, border-color 0.3s ease"
        }}
        onMouseEnter={(e) => (e.currentTarget.style.transform = "scale(1.02)")}
        onMouseLeave={(e) => (e.currentTarget.style.transform = "scale(1)")}
      >
        <div style={{ 
          pointerEvents: "none", 
          opacity: 0.8, 
          maxHeight: "400px", 
          overflow: "hidden" 
        }}>
          <SavedTablesPage previewMode={true} />
        </div>
        <div
          style={{
            position: "absolute",
            top: "1rem",
            left: "1rem",
            background: theme.background,
            color: theme.accent,
            fontWeight: "bold",
            padding: "0.5rem 1rem",
            borderRadius: "8px",
            fontSize: "0.9rem",
            transition: "background-color 0.3s ease, color 0.3s ease"
          }}
        >
          Open Saved Logs →
        </div>
      </div>

      <h1 style={{ 
        fontSize: "2.5rem", 
        marginBottom: "1rem",
        color: theme.accent,
        transition: "color 0.3s ease"
      }}>
        Welcome to your Dashboard
      </h1>
      <p style={{ 
        marginTop: "1rem", 
        opacity: 0.7,
        fontSize: "1.1rem",
        lineHeight: "1.6",
        color: theme.textSecondary,
        transition: "color 0.3s ease"
      }}>
        This space will soon show your analytics, recent logs, and suggested training insights.
      </p>
    </div>
  );
}
